commonfields:
  id: TCell
  version: -1
name: TCell
display: TCell
fromversion: 2.6.0
releaseNotes: Initial addition of TCell
category: IT Services
image: data:image/png;base64,
description: TCell is a cloud based web application firewall
configuration:
- display: Server URL (e.g. https://192.168.0.1)
  name: server
  defaultvalue: ""
  type: 0
  required: true
- display: API Key (Full Access)
  name: api_key
  defaultvalue: ""
  type: 0
  required: true
- display: Do not validate server certificate (insecure)
  name: insecure
  defaultvalue: ""
  type: 8
  required: false
- display: "Proxy"
  name: proxy
  defaultvalue: ""
  type: 8
  required: false
script:
  script: |+
    var apiKey = params.api_key;
    var server = params.server;
    var proxy = params.proxy;
    var insecure = params.insecure;

    if (server[server.length - 1] === '/') {
        server = server.substring(0, server.length - 1);
    }

    var urlDictionary = {
            'tcell-list-apps': 'apps',
            'tcell-get-app': 'apps/%APP_ID%',
            'tcell-list-agents': 'apps/%APP_ID%/agents',
            'tcell-agent-data': 'apps/%APP_ID%/agents/%AGENT_ID%',
            'tcell-app-routes': 'apps/%APP_ID%/routes',
            'tcell-app-route-data': 'apps/%APP_ID%/routes/%ROUTE_ID%',
            'tcell-app-inline-scripts': 'apps/%APP_ID%/inline_scripts',
            'tcell-app-inline-script-data':'apps/%APP_ID%/inline_scripts/%SCRIPT_ID%',
            'tcell-app-packages':'apps/%APP_ID%/packages',
            'tcell-app-package-data':'apps/%APP_ID%/packages/%PACKAGE_ID%',
            'tcell-app-source-events':'apps/%APP_ID%/sources/%SOURCE%/events',
            'tcell-app-events-table':'apps/%APP_ID%/sources/%SOURCE%/events/table',
            'tcell-sources-event-data':'apps/%APP_ID%/sources/%SOURCE%/events/%EVENT_ID%',
            'tcell-app-configs':'apps/%APP_ID%/configs',
            'tcell-app-config-latest':'apps/%APP_ID%/configs/latest',
            'tcell-app-config-data':'apps/%APP_ID%/configs/%CONFIG_ID%',
            'tcell-app-push-config':'apps/%APP_ID%/configs'

    };

    var methodDictionary = {
            'tcell-list-apps': 'GET',
            'tcell-get-app': 'GET',
            'tcell-list-agents': 'GET',
            'tcell-agent-data': 'GET',
            'tcell-app-routes': 'GET',
            'tcell-app-route-data': 'GET',
            'tcell-app-inline-scripts': 'GET',
            'tcell-app-inline-script-data':'GET',
            'tcell-app-packages':'GET',
            'tcell-app-package-data':'GET',
            'tcell-app-source-events':'GET',
            'tcell-app-events-table':'GET',
            'tcell-sources-event-data':'GET',
            'tcell-app-configs':'GET',
            'tcell-app-config-latest':'GET',
            'tcell-app-config-data':'GET',
            'tcell-app-push-config':'POST'

    }


    var tcellListApps = function() {
        var respBody = sendRequest(methodDictionary['tcell-list-apps'], urlDictionary['tcell-list-apps'],'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell Apps', respBody.apps),
            EntryContext: {'tcell_apps':respBody.apps}
        };

    }
    var tcellGetApp = function() {
        var urlPath = urlDictionary['tcell-get-app'].replace('%APP_ID%', args.appid);
        var respBody = sendRequest(methodDictionary['tcell-get-app'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App', [respBody.app]),
            EntryContext: {'tcell_app_info': [respBody.app]}
        };
    }

    var tcellListAgents = function() {
        var urlPath = urlDictionary['tcell-list-agents'].replace('%APP_ID%', args.appid);
        var respBody = sendRequest(methodDictionary['tcell-list-agents'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell Agents', respBody.agents),
            EntryContext: {'tcell_agents_list': respBody.agents}
        };
    }

    var tcellAgentData = function() {
        var urlPath = urlDictionary['tcell-agent-data'].replace('%APP_ID%', args.appid).replace('%AGENT_ID%',args.agentid);
        var respBody = sendRequest(methodDictionary['tcell-agent-data'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell Agent Data For: ' + args.appid, [respBody.agent]),
            EntryContext: {'tcell_agent_data': [respBody.agent]}
        };
    }

    var tcellAppRoutes = function() {
        var urlPath = urlDictionary['tcell-app-routes'].replace('%APP_ID%', args.appid);
        var respBody = sendRequest(methodDictionary['tcell-app-routes'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Routes', respBody.routes),
            EntryContext: {'tcell_app_routes': respBody.routes}
        };
    }

    var tcellAppRouteData = function() {
        var urlPath = urlDictionary['tcell-app-route-data'].replace('%APP_ID%', args.appid).replace('%ROUTE_ID%', args.routeid);
        var respBody = sendRequest(methodDictionary['tcell-app-route-data'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Route Data', [respBody.route]),
            EntryContext: {'tcell_app_route_details': [respBody.route]}
        };
    }
    var tcellAppInlineScripts = function() {
        var urlPath = urlDictionary['tcell-app-inline-scripts'].replace('%APP_ID%', args.appid);
        var respBody = sendRequest(methodDictionary['tcell-app-inline-scripts'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Inline Scripts', respBody.inline_scripts),
            EntryContext: {'tcell_app_inline_scripts': respBody.inline_scripts}
        };
    }
    var tcellAppInlineScriptData = function() {
        var urlPath = urlDictionary['tcell-app-inline-script-data'].replace('%APP_ID%', args.appid).replace('%SCRIPT_ID%', args.scriptid);
        var respBody = sendRequest(methodDictionary['tcell-app-inline-script-data'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Inline Script Data', [respBody.inline_script]),
            EntryContext: {'tcell_inline_script_data': [respBody.inline_script]}
        };
    }
    var tcellAppPackages = function() {
        var urlPath = urlDictionary['tcell-app-packages'].replace('%APP_ID%', args.appid);
        var respBody = sendRequest(methodDictionary['tcell-app-packages'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Packages For:' + args.appid, respBody.routes),
            EntryContext: {'tcell_app_packages': respBody.routes}
        };
    }
    var tcellAppPackageData = function() {
        var urlPath = urlDictionary['tcell-app-package-data'].replace('%APP_ID%', args.appid).replace('%PACKAGE_ID%', args.packageid);
        var respBody = sendRequest(methodDictionary['tcell-app-package-data'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Package Data For:' + args.appid, [respBody.package]),
            EntryContext: {'tcell_app_package_data':[respBody.package]}
        };
    }
    var tcellAppSourceEvents = function() {
        var urlPath = urlDictionary['tcell-app-source-events'].replace('%APP_ID%', args.appid).replace('%SOURCE%', args.source);
        var respBody = sendRequest(methodDictionary['tcell-app-source-events'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Source Events For: ' + args.appid, respBody.events),
            EntryContext: {'tcell_app_source_events':respBody.events}
        };
    }
    var tcellAppEventsTable = function() {
        var urlPath = urlDictionary['tcell-app-events-table'].replace('%APP_ID%', args.appid).replace('%SOURCE%', args.source);
        var respBody = sendRequest(methodDictionary['tcell-app-events-table'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Source Events For: ' + args.appid, respBody.events),
            EntryContext: {'tcell_app_events_table':respBody.events}
        };

    }
    var tcellSourcesEventData = function() {
        var urlPath = urlDictionary['tcell-sources-event-data'].replace('%APP_ID%', args.appid).replace('%SOURCE%', args.source).replace('%EVENT_ID%', args.eventid);
        var respBody = sendRequest(methodDictionary['tcell-sources-event-data'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Source Event Data For: ' + args.appid, respBody),
            EntryContext: {'tcell_sources_event_data': respBody}
        };

    }
    var tcellAppConfigs = function() {
        var urlPath = urlDictionary['tcell-app-configs'].replace('%APP_ID%', args.appid);
        var respBody = sendRequest(methodDictionary['tcell-app-configs'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Configs For: ' + args.appid, respBody.configs),
            EntryContext: {'tcell_app_configs': respBody.configs}
        };
    }
    var tcellAppConfigLatest = function() {
        var urlPath = urlDictionary['tcell-app-config-latest'].replace('%APP_ID%', args.appid).replace('%CONFIG_ID%', args.configid);
        var respBody = sendRequest(methodDictionary['tcell-app-config-latest'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Configs For: ' + args.appid, [respBody.config]),
            EntryContext: {'tcell_app_config_latest': [respBody.config]}
        };
    }
    var tcellAppConfigData = function() {
        var urlPath = urlDictionary['tcell-app-config-data'].replace('%APP_ID%', args.appid).replace('%CONFIG_ID%', args.configid);
        var respBody = sendRequest(methodDictionary['tcell-app-config-data'],urlPath,'', '');
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: tableToMarkdown('TCell App Configs For: ' + args.appid, [respBody.config]),
            EntryContext: {'tcell_app_config_data': [respBody.config]}
        };
    }
    var tcellAppPushConfig = function() {
        var urlPath =  urlDictionary['tcell-app-push-config'].replace('%APP_ID%', args.appid);
        var blacklistips = [];
        var whitelistips = [];
        if('blacklistips' in args) {
            blacklistips = args.blacklistips.replace(' ','').split(',');
        }
        if('whitelistips' in args) {
            whitelistips = args.whitelistips.replace(' ','').split(',');
        }
        var configBody = {
            "version": 1,
            "blockedips": {
              "suspiciousMode": "Filtered",
              "blacklistedIps": blacklistips,
              "whitelistedIps": whitelistips,
              "version": 1
            }
          };

        var respBody = sendRequest(methodDictionary['tcell-app-push-config'], urlPath,'',configBody, '','');
        var message = ('id' in respBody)? respBody.id : 'Nothing to update';
        return {
            Type: entryTypes.note,
            Contents: respBody,
            ContentsFormat: formats.json,
            HumanReadable: '# Successfully Pushed The TCell Config - #' + message,
            EntryContext: {'tcell_app_config_update': [respBody]}
        };
    }



    var sendRequest = function(method, urlpath, headers, bodyData, cookies) {
            var completeUrl = server + '/' + urlpath;
            var reqObj = {};
            reqObj.Method = method;
            reqObj.Headers = {
                        'Authorization': ['Bearer ' + apiKey],
                        'Content-Type': ['application/json']
                    };
            if(bodyData) {
                reqObj.Body = JSON.stringify(bodyData);
            }
            var res = http(
                completeUrl,
                reqObj,
                params.insecure,
                proxy,
                true
            );
            if (res.StatusCode < 200 || res.StatusCode >= 300) {
                throw 'Action failed, request status code: ' + res.StatusCode + ' and Body: ' + res.Body + '.';
            }

            if (res.Headers['Content-Type'][0] != 'application/json') {
                throw 'Response Content-Type is not application/json.';
            }

            return JSON.parse(res.Body);

    }














    // The command input arg holds the command sent from the user.
    switch (command) {
        // This is the call made when pressing the integration test button.
        case 'test-module':
            try {
                tcellListApps();
            } catch(e) {
                return "Error:" + e.message;
            }
            return 'Success';
        case 'tcell-list-apps':
            return tcellListApps();
        case 'tcell-get-app':
            return tcellGetApp();
        case 'tcell-list-agents':
            return tcellListAgents();
        case 'tcell-agent-data':
            return tcellAgentData();
        case 'tcell-app-routes':
            return tcellAppRoutes();
        case 'tcell-app-route-data':
            return tcellAppRouteData();
        case 'tcell-app-inline-scripts':
            return tcellAppInlineScripts();
        case 'tcell-app-inline-script-data':
            return tcellAppInlineScriptData();
        case 'tcell-app-packages':
            return tcellAppPackages();
        case 'tcell-app-package-data':
            return tcellAppPackageData();
        case 'tcell-app-source-events':
            return tcellAppSourceEvents();
        case 'tcell-app-events-table':
            return tcellAppEventsTable();
        case 'tcell-sources-event-data':
            return tcellSourcesEventData();
        case 'tcell-app-configs':
            return tcellAppConfigs();
        case 'tcell-app-config-latest':
            return tcellAppConfigLatest();
        case 'tcell-app-config-data':
            return tcellAppConfigData();
        case 'tcell-app-push-config':
            return tcellAppPushConfig();

        case 'fetch-incidents':

            // JSON of the incident type created by this integration
            // You can store the last run as a string using set last run.
            setLastRun({'time': 'now'});
            // And you can retrieve it in any other call...
            var now = getLastRun();
            // now is an object with field time, that has value 'now'.
            return JSON.stringify([{"Name":"Incident #1"},{"Name":"Incident #2"}]);
        default:
            // You can use args[argName] or args.argName to get a specific arg. args are strings.
            // You can use params[paramName] or params.paramName to get a specific params.
            // Params are of the type given in the integration page creation.
    }


  type: javascript
  commands:
  - name: tcell-list-apps
    arguments: []
    outputs:
    - contextPath: tcell_apps
      description: Provides an array of Tcell Apps with ID's and Names
    description: Lists the apps available in TCell
  - name: tcell-get-app
    arguments:
    - name: appid
      required: true
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    outputs:
    - contextPath: tcell_app_info
      description: Provides the ID and AppName for a specific TCell App
    description: Get specific app level data like the app id from tcell
  - name: tcell-list-agents
    arguments:
    - name: appid
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    outputs:
    - contextPath: tcell_list_agents
      description: 'Provides a list of Tcell Agents '
    description: 'This will list the agents that are install onto an Application that
      uses TCell. Agents that are installed will have specific information like the
      version etc. '
  - name: tcell-agent-data
    arguments:
    - name: appid
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    - name: agentid
      description: The agent id can be found by getting a list of the agents for an
        App based on the appid
    outputs:
    - contextPath: tcell_agent_data
      description: ' Provides Configuration Information For The Agent That Is Installed'
    description: 'This will get more details about a specific agent that is installed
      on an App that uses TCell based on the AgentID. '
  - name: tcell-app-routes
    arguments:
    - name: appid
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    outputs:
    - contextPath: tcell_app_routes
      description: Provides a list of Objects containing the web paths  for a specific
        app
    description: This will return all of the commonly found routes for an Application
      that uses TCell. Routes are tracked either through the firewall or through the
      injected scripts.
  - name: tcell-app-route-data
    arguments:
    - name: appid
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    - name: routeid
      description: 'The route id can be found by getting a list of routes '
    outputs:
    - contextPath: tcell_app_route_details
      description: 'Specific Route Details For A Given RouteID and AppID and provides
        path and request information. '
    description: This will get specific route information based on a routeID. Take
      a look at the route information for a specific app and then get more detailed
      information.
  - name: tcell-app-inline-scripts
    arguments:
    - name: appid
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    outputs:
    - contextPath: tcell_app_inline_scripts
      description: Provides an array of data associated to the inline scripts that
        are injected from the app firewall into the clients browser. Contains an ID
        of the Inline script, when it was created, and a sha256 of the script for
        the app firewall.
    description: This will gather information on the inline-scripts that were injected
      and running on an application based on the appid within TCell.
  - name: tcell-app-inline-script-data
    arguments:
    - name: appid
      description: 'Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) '
    - name: scriptid
      description: To obtain the scriptid you must first look at tcell-app-inline-scripts.
        This will provide a list of scriptids so that you can see what scripts were
        inline with the app.
    outputs:
    - contextPath: tcell_inline_script_data
      description: Provides more details on where the TCell script was injected into
        the client or what triggered the EVENT.
    description: 'This will gather more detailed information on an inline script within
      TCell. '
  - name: tcell-app-packages
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    outputs:
    - contextPath: tcell_app_packages
      description: 'Provides a list of software packages installed on the web app. '
    description: List of installed packages - This provides a list of packages that
      are installed on the web application that uses TCell. If possible it will list
      out the versions etc.
  - name: tcell-app-package-data
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    - name: packageid
      description: The packageid can be found by getting a list of the packages available
        for the appid.
    outputs:
    - contextPath: tcell_app_package_data
      description: Provides more details data around a specific package installed
        on the web app.
    description: This will provide specific details around a package that is installed
      on a web app that uses TCell. Package details may include what type, the version
      and other information if found.
  - name: tcell-app-source-events
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    - name: source
      auto: PREDEFINED
      predefined:
      - appfirewall
      - inline
      - login
      - csp
      description: 'Event source (Valid sources: appfirewall, inline, login, csp)'
    outputs:
    - contextPath: tcell_app_source_events
      description: 'Provides an array of Source Events Occuring Against the Firewall,
        The URL Location that it occured, '
    - contentPath: ${tcell_app_source_events.location}
      contextPath: tcell_app_source_locations
      description: A List of App URL's being attacked
    description: This provides a list of source events for what was being attacked.
  - name: tcell-app-events-table
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    - name: source
      auto: PREDEFINED
      predefined:
      - appfirewall
      - inline
      - login
      - csp
      description: The source is either appfirewall, inline, login, csp These are
        primarily the source of the events that occured.
    outputs:
    - contextPath: tcell_sources_events_table
      description: produces results of the events into a filtering and query like
        format
    description: 'Note: Has Issues - This provides a list of filtering and querying
      options for events that come in from different sources like firewalls etc.'
  - name: tcell-sources-event-data
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    - name: source
      auto: PREDEFINED
      predefined:
      - appfirewall
      - inline
      - login
      - csp
      description: The sourve of the event like appfirewall, inline, login, csp, basically
        where did the event come from.
    - name: eventid
    outputs:
    - contextPath: tcell_sources_event_data
      description: Specific Event Data for a givent event ID
    description: This will get specific event data based on the eventID which is found
      by getting the source-events. The source events will gather all of the source
      events for a specific app and this will gather more information for that event.
  - name: tcell-app-configs
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    outputs:
    - contextPath: tcell_app_configs
      description: Produces a list of App Configurations for a given App ID
    description: 'This will gather the current configurations for a web app installed
      with TCell. '
  - name: tcell-app-config-latest
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    outputs:
    - contextPath: tcell_app_config_latest
      description: 'Provides a list of the latest configs for an APP. '
    description: This will gather the latest configuration for a app that uses Tcell
  - name: tcell-app-config-data
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    - name: configid
      description: The configurateion will be generally be the id listed in the latest
        config for this app.
    outputs:
    - contextPath: tcell_app_config_data
      description: Specific app configuration data which explains how an app is configured
        within TCell.
    description: This will gather more details about a specific configuration for
      an app based on the appid.
  - name: tcell-app-push-config
    arguments:
    - name: appid
      description: Enter the AppID it looks like (tCellWebGoatAWS1-YE41C) and can
        be obtained by getting the command that gets the list of apps.
    - name: blacklistips
      description: Enter a comma delimited list of IPs to blacklist
    - name: whitelistips
      description: Enter a comma delimited list of IPs to blacklist
    outputs:
    - contextPath: tcell_app_config_update
      description: Returns the ID of the configuration that was just updated.
    description: 'This is a really useful command. It will allow you to block and
      blacklist or whitelist IP addresses by pushing a new configuration to an application
      configured to use TCell. Simply add the appid, the blacklistips or whitelistips
      and it will push the configuration. This will then update the firewall and inline
      scripts so that these types of ips are managed properly. Here''s an example:
      !tcell-app-push-config appid="tCellWebGoatAWS1-YE41C" blacklistips="54.194.139.246"
      using=TCell_Put_Instance'
hidden: false
system: true
